import React from 'react';
import logo from './logo.svg';
import './App.css';
function App() {
  const age = 15;
  if (age >= 18) {
    return <h1>Qualified to vote</h1>
  }
  else {
    return <div className="App">
      <h1> Not Qualified </h1>
    </div>
  }
  const StudentInfo = (props) => {
    return (
      <div className="StudentInfo">
        <h1>Name: {props.name}</h1>
        <h1>Course: {props.course}</h1>
      </div>
    );
  };

  const Job = (props) => {
    return (
      <div className="Job">
        <img className="CompanyLogo" src={logo} alt="Company Logo" />

      </div>
    );
  };

  function App() {
    return (
      <div className="App">
        <StudentInfo name="dem charles bule" course="BSIS NS-3A" />

      </div>
    );
  }
}
export default App;
